CKEDITOR.plugins.setLang("a11yhelp","fr-ca",{title:"Instructions d'accessibilit\xe9",contents:"Contenu de l'aide.  Pour fermer cette fen\xeatre, appuyez sur ESC.",legend:[{name:"G\xe9n\xe9ral",items:[{name:"Barre d'outil de l'\xe9diteur",legend:"Appuyer sur ${toolbarFocus} pour acc\xe9der \xe0 la barre d'outils. Se d\xe9placer vers les groupes suivant ou pr\xe9c\xe9dent de la barre d'outil avec les touches TAB et SHIFT-TAB. Se d\xe9placer vers les boutons suivant ou pr\xe9c\xe9dent de la barre d'outils avec les touches FLECHE DROITE et FLECHE GAUCHE. Appuyer sur la barre d'espace ou la touche ENTRER pour activer le bouton de barre d'outils."},{name:"Dialogue de l'\xe9diteur",legend:"A l'int\xe9rieur d'un dialogue, appuyer sur la touche TAB pour naviguer jusqu'au champ de dalogue suivant, appuyez sur les touches SHIFT + TAB pour revenir au champ pr\xe9c\xe9dent, appuyez sur la touche ENTRER pour soumettre le dialogue, appuyer sur la touche ESC pour annuler le dialogue. Pour les dialogues avec plusieurs pages d'onglets, appuyer sur ALT + F10 pour naviguer jusqu'\xe0 la liste des onglets. Puis se d\xe9placer vers l'onglet suivant avec la touche TAB ou FLECHE DROITE. Se d\xe9placer vers l'onglet pr\xe9c\xe9dent avec les touches SHIFT + TAB ou FLECHE GAUCHE. Appuyer sur la barre d'espace ou la touche ENTRER pour s\xe9lectionner la page de l'onglet."},{name:"Menu contextuel de l'\xe9diteur",legend:"Appuyer sur ${contextMenu} ou entrer le RACCOURCI CLAVIER pour ouvrir le menu contextuel. Puis se d\xe9placer vers l'option suivante du menu avec les touches TAB ou FLECHE BAS. Se d\xe9placer vers l'option pr\xe9c\xe9dente avec les touches SHIFT+TAB ou FLECHE HAUT. appuyer sur la BARRE D'ESPACE ou la touche ENTREE pour s\xe9lectionner l'option du menu. Oovrir le sous-menu de l'option courante avec la BARRE D'ESPACE ou les touches ENTREE ou FLECHE DROITE. Revenir \xe0 l'\xe9l\xe9ment de menu parent avec les touches ESC ou FLECHE GAUCHE. Fermer le menu contextuel avec ESC."},{name:"Menu d\xe9roulant de l'\xe9diteur",legend:"A l'int\xe9rieur d'une liste en menu d\xe9roulant, se d\xe9placer vers l'\xe9l\xe9ment suivant de la liste avec les touches TAB ou FLECHE BAS. Se d\xe9placer vers l'\xe9l\xe9ment pr\xe9c\xe9dent de la liste avec les touches SHIFT + TAB ou FLECHE HAUT. Appuyer sur la BARRE D'ESPACE ou sur ENTREE pour s\xe9lectionner l'option dans la liste. Appuyer sur ESC pour fermer le menu d\xe9roulant."},{name:"Barre d'emplacement des \xe9l\xe9ments de l'\xe9diteur",legend:"Appuyer sur ${elementsPathFocus} pour naviguer vers la barre d'emplacement des \xe9l\xe9ments de l\xe9diteur. Se d\xe9placer vers le bouton d'\xe9l\xe9ment suivant avec les touches TAB ou FLECHE DROITE. Se d\xe9placer vers le bouton d'\xe9l\xe9ment pr\xe9c\xe9dent avec les touches SHIFT+TAB ou FLECHE GAUCHE. Appuyer sur la BARRE D'ESPACE ou sur ENTREE pour s\xe9lectionner l'\xe9l\xe9ment dans l'\xe9diteur."}]},{name:"Commandes",items:[{name:"Annuler",legend:"Appuyer sur ${undo}"},{name:"Refaire",legend:"Appuyer sur ${redo}"},{name:"Gras",legend:"Appuyer sur ${bold}"},{name:"Italique",legend:"Appuyer sur ${italic}"},{name:"Soulign\xe9",legend:"Appuyer sur ${underline}"},{name:"Lien",legend:"Appuyer sur ${link}"},{name:"Enrouler la barre d'outils",legend:"Appuyer sur ${toolbarCollapse}"},{name:"Acc\xe9der \xe0 l'objet de focus pr\xe9c\xe9dent",legend:"Appuyer ${accessPreviousSpace} pour acc\xe9der au prochain espace disponible avant le curseur, par exemple: deux \xe9l\xe9ments HR adjacents.  R\xe9p\xe9ter la combinaison pour joindre les \xe9l\xe9ments d'espaces distantes."},{name:"Acc\xe9der au prochain objet de focus",legend:"Appuyer ${accessNextSpace} pour acc\xe9der au prochain espace disponible apr\xe8s le curseur, par exemple: deux \xe9l\xe9ments HR adjacents.  R\xe9p\xe9ter la combinaison pour joindre les \xe9l\xe9ments d'espaces distantes."},{name:"Aide d'accessibilit\xe9",legend:"Appuyer sur ${a11yHelp}"}]}]});